const UsersContext = React.createContext({
  users: [
    { id: 'u1', name: 'Peter' },
    { id: 'u2', name: 'Moses' },
    { id: 'u3', name: 'Francis' },
    { id: 'u5', name: 'Delphister' },
    { id: 'u6', name: 'Agness' },
  ]
});

export default UsersContext;
